    def capacitor_current(self):
            v = self.period()
            x = np.linspace(1, 8, 301)
            print(x)
            fig = plt.figure()
            ax = fig.add_subplot(111)
            fig.patch.set_facecolor("#b2b5a3")
            ax.patch.set(facecolor="#41a8aa")
            plt.plot(x, (self.v1value1()/self.resistorvalue1()*np.exp(-x/(self.resistorvalue1()*self.capacitorvalue()))))
            plt.xlabel("                                   t")
            plt.ylabel("Ic")
            plt.grid(True)
            plt.savefig('graph7.png')
            self.label_51.setPixmap(QtGui.QPixmap("graph7.png"))
            self.label.setScaledContents(True)

    def capacitor_voltage(self):
            x = np.linspace(1, 3, 301)
            fig = plt.figure()
            ax = fig.add_subplot(111)
            fig.patch.set_facecolor("#b2b5a3")
            ax.patch.set(facecolor="#41a8aa")
            print("i was here")
            plt.plot(x,(self.v1value1()*(1-(np.exp(-x/(self.resistorvalue1()*self.capacitorvalue()))))))
            print("capvolt")
            plt.xlabel("                                   t")
            plt.ylabel("Vc")
            plt.grid(True)
            plt.savefig('graph8.png')
            self.label_51.setPixmap(QtGui.QPixmap("graph8.png"))
            self.label.setScaledContents(True)


    def inductor_voltage(self):
            v = self.period()
            x = np.linspace(1, 3, 301)
            print(x)
            volt =(float(self.V_value.text())*(np.exp(float(self.RL)*(-x)/(float(self.LL)))))
            fig = plt.figure()
            ax = fig.add_subplot(111)
            fig.patch.set_facecolor("#b2b5a3")
            ax.patch.set(facecolor="#41a8aa")
            print(volt)
            plt.plot(x, (float(self.V_value.text())*(np.exp(float(self.RL)*(-x)/(float(self.LL))))))
            plt.xlabel("                                   t")
            plt.ylabel("IL")
            plt.grid(True)
            plt.savefig('graph100.png')
            self.label_51.setPixmap(QtGui.QPixmap("graph100.png"))
            self.label.setScaledContents(True)

